    #region Xml Write Mixins
    public static class WeatherXmlTranslationMixIn
    {
        public static void WriteToXml(
            this IWeatherGetter item,
            XElement node,
            out Weather_ErrorMask errorMask,
            bool doMasks = true,
            Weather_TranslationMask translationMask = null,
            string name = null)
        {
            ErrorMaskBuilder errorMaskBuilder = doMasks ? new ErrorMaskBuilder() : null;
            ((WeatherXmlWriteTranslation)item.XmlWriteTranslator).Write(
                item: item,
                name: name,
                node: node,
                errorMask: errorMaskBuilder,
                translationMask: translationMask?.GetCrystal());
            errorMask = Weather_ErrorMask.Factory(errorMaskBuilder);
        }

        public static void WriteToXml(
            this IWeatherGetter item,
            string path,
            out Weather_ErrorMask errorMask,
            Weather_TranslationMask translationMask = null,
            bool doMasks = true,
            string name = null)
        {
            var node = new XElement("topnode");
            WriteToXml(
                item: item,
                name: name,
                node: node,
                errorMask: out errorMask,
                doMasks: doMasks,
                translationMask: translationMask);
            node.Elements().First().SaveIfChanged(path);
        }

        public static void WriteToXml(
            this IWeatherGetter item,
            Stream stream,
            out Weather_ErrorMask errorMask,
            Weather_TranslationMask translationMask = null,
            bool doMasks = true,
            string name = null)
        {
            var node = new XElement("topnode");
            WriteToXml(
                item: item,
                name: name,
                node: node,
                errorMask: out errorMask,
                doMasks: doMasks,
                translationMask: translationMask);
            node.Elements().First().Save(stream);
        }

    }
